function generateWords() {
    const wordContainer = document.querySelector("#generated-passphrase-field");
    var passValue = $('#generated-passphrase-field .pass-value');
    for (const word of _.sampleSize(words, 17)) {
        passValue.append(word + " ");
    }
    $('#generated-passphrase-field').attr("data-phrase", passValue.text());
}
