$('#messages-tab').click(function(){
    $('#transactions-tab').removeClass('active');
    $(this).addClass('active');
    $('.bened-main .dashboard .activity .items.transactions').removeClass('open');
    $('.bened-main .dashboard .activity .items.messages').addClass('open');
});

/* Activity items show/hide in Dashboard */
$('body').on('click', '.activity .items .item .arrow', function(){
    var item = $(this).closest('.item');
    var value = item.find('.value');
    arrow = $(this);
    action = $(this);
    $(value).slideToggle(300, function() {
        item.toggleClass('open');
        value.toggleClass('open');
        action.toggleClass('open');
    });

    if(arrow.hasClass('down')) {
        arrow.removeClass('down');
        arrow.addClass('top');
    } else {
        arrow.addClass('down');
        arrow.removeClass('top');
    }
});

/* Wallet info show/hide in Dashboard */
$('.bened-main .dashboard .account .user .wallet').click(function(){
    var info = $('.bened-main .dashboard .account .user .wallet-info'),
    arrow = $('.bened-main .dashboard .account .user .wallet'),
    action = $(this);
    $(info).slideToggle(300, function() {
        info.toggleClass('open');
        action.toggleClass('open');
    });
    if(arrow.hasClass('down')) {
        arrow.removeClass('down');
        arrow.addClass('up');
    } else {
        arrow.addClass('down');
        arrow.removeClass('up');
    }
});

/* CopyBar show/hide */
$('.bened-main .left-panel .card .balance .download').click(function(){
    var copyBar = $('.bened-main .left-panel .copy-bar'),
    dashboard = $('.bened-main .col-lg-9.dashboard');
    $(copyBar).slideToggle(300, function() {
        dashboard.toggleClass('dash-top');
        copyBar.toggleClass('open');
    });
});

/* Menu in Mobile Version */
if(isMobile) {
    $('.bened-main .left-panel .bottom-bar .dashboard, .bened-main .left-panel .menu .dashboard, .bened-main .left-panel .burger-button').click(function () {
        var progressBar = $('.bened-main .left-panel .progress-bar');
        $(".bened-main .left-panel .menu").toggle("slide", { direction: "left" }, 200);
        progressBar.toggleClass('close');
        $(".bened-main .col-lg-9.dashboard").toggle("slide", { direction: "right" }, 200);
    });
}

$('#burger-menu-control').click(function () {
    $('#sidebar.left-panel').toggleClass('hide');
});
$(document).ready(function(){
    if(isMobile || $(window).width() < 768) {
        $('#sidebar.left-panel').toggleClass('hide');
        $('body').on('click', '.bened-main .left-panel .menu li', function(e){
            e.preventDefault();
            $('#sidebar.left-panel').toggleClass('hide');
            return false;
        });
    }
});
